using System;
using System.Collections.Generic;
using System.IO;
using Phantasma.Core.Types;
using Phantasma.Core.Utils;
using Phantasma.Cryptography;
using Phantasma.Domain;
using Phantasma.Ethereum;
using Phantasma.Neo.Core;
using Phantasma.Numerics;
using Phantasma.SDK;

namespace Phantasma.Dapps
{
    public class SampleConnector : WalletLink
    {
        private readonly PhantasmaAPI api;
        private string WIF = "L4cMNZPCQACkjVu74jfdstoeJQozg5QEveCUvvw4tAYGoyC5qjEU";

        protected override WalletStatus Status => WalletStatus.Ready;

        public override string Name => "Sample Connector";
        public override string Nexus => "simnet";

        public SampleConnector(PhantasmaAPI api) : base()
        {
            this.api = api;
        }

        private IKeyPair GetKeys(string platform)
        {
            switch (platform)
            {
                case "phantasma":
                    return PhantasmaKeys.FromWIF(this.WIF);

                case "neo":
                    return NeoKeys.FromWIF(this.WIF);

                case "ethereum":
                    return EthereumKey.FromWIF(this.WIF);

                default:
                    return null;
            }
        }

        protected override void GetAccount(string platform, Action<Account, string> callback)
        {
            IKeyPair keys = GetKeys(platform);

            if (keys == null)
            {
                callback(new Account(), "unsupported platform: " + platform);
                return;
            }

            string address;
            string external;

            switch (platform)
            {
                case "phantasma":
                    address = ((PhantasmaKeys)keys).Address.Text;
                    external = "";
                    break;

                case "neo":
                    {
                        var bytes = new byte[34];
                        bytes[0] = (byte)AddressKind.User;
                        ByteArrayUtils.CopyBytes(keys.PublicKey, 0, bytes, 1, 33);
                        var ext_addr = Address.FromBytes(bytes);
                        
                        address = ext_addr.Text;
                        external = ((NeoKeys)keys).Address;
                        break;
                    }

                case "ethereum":
                    {
                        var bytes = new byte[34];
                        bytes[0] = (byte)AddressKind.User;
                        ByteArrayUtils.CopyBytes(keys.PublicKey, 0, bytes, 1, 33);                        
                        var ext_addr = Address.FromBytes(bytes);

                        address = ext_addr.Text;
                        external = ((EthereumKey)keys).Address;
                        break;
                    }

                default:
                    throw new Exception("not implemented: " + platform);
            }

            callback(new Account()
            {
                address = address,
                platform = platform,
                external = external,
                alias = "sergio",
                name = "Mr.Phantasma",
                avatar = "data:image/png;base64,",
                balances = GetBalances(platform),
                files = new File[]
                {
                    new File(){ name = "hello.txt", hash = "e3b0c44298fc1c149afbf4c8996fb92427ae41e4649b934ca495991b7852b855", size = 1024 , date = 1584404874 },
                    new File(){ name = "second.txt", hash = "c8996fb92427ae41e4649b934ca495991b7852b855e3b0c44298fc1c149afbf4", size = 204888, date = 1584804874 },
                },
            }, null);
        }

        private Balance[] GetBalances(string platform)
        {
            var list = new List<Balance>();
            list.Add(new Balance() { symbol = "SOUL", value = "10000000000", decimals = 8 });
            list.Add(new Balance() { symbol = "KCAL", value = "2000000000000", decimals = 10 });

            switch (platform)
            {
                case "neo":
                    list.Add(new Balance() { symbol = "GAS", value = "2000000000000", decimals = 8 });
                    break;

                case "ethereum":
                    list.Add(new Balance() { symbol = "ETH", value = "20000000000000000", decimals = 18 });
                    break;

            }
            return list.ToArray();
        }

        protected override void InvokeScript(string chain, byte[] script, int id, Action<byte[], string> callback)
        {
            api.InvokeRawScript(chain, Base16.Encode(script), (x) =>
            {
                callback(Base16.Decode(x.result), null);

            }, (error, log) =>
            {
                callback(null, log);
            });
        }

        protected override void SignTransaction(string platform, SignatureKind kind, string chain, byte[] script, byte[] payload, int id, Action<Hash, string> callback)
        {
            IKeyPair keys = GetKeys(platform);

            if (keys == null)
            {
                callback(Hash.Null, "unsupported platform: " + platform);
                return;
            }

            var expiration = (Timestamp)(DateTime.UtcNow + TimeSpan.FromMinutes(20));
            var tx = new Phantasma.Blockchain.Transaction(this.Nexus, chain, script, expiration, payload);

            tx.Sign(keys);

            callback(tx.Hash, null);
        }

        protected override void Authorize(string dapp, string token, int version, Action<bool, string> callback)
        {
            callback(true, null); // this accepts everything, in a real connect the user should be prompted!
        }

        protected override void SignData(string platform, SignatureKind kind, byte[] data, int id, Action<string, string, string> callback)
        {
            IKeyPair keys = GetKeys(platform);

            if (keys == null)
            {
                callback(null, null, "unsupported platform: " + platform);
                return;
            }

            switch (platform)
            {
                case "neo":
                    if (kind != SignatureKind.ECDSA)
                    {
                        callback(null, null, $"unsupported signature: {kind} @ {platform}");
                        return;
                    }
                    break;

                case "ethereum":
                    if (kind != SignatureKind.ECDSA)
                    {
                        callback(null, null, $"unsupported signature: {kind} @ {platform}");
                        return;
                    }
                    break;
            }

            var randomValue = DateTime.UtcNow.Ticks;
            var randomBytes = BitConverter.GetBytes(randomValue);

            var msg = ByteArrayUtils.ConcatBytes(randomBytes, data);
            var signature = keys.Sign(msg);

            byte[] sigBytes = null;

            using (var stream = new MemoryStream())
            {
                using (var writer = new BinaryWriter(stream))
                {
                    writer.WriteSignature(signature);
                }

                sigBytes = stream.ToArray();
            }

            var hexSig = Base16.Encode(sigBytes);
            var hexRand = Base16.Encode(randomBytes);

            callback(hexSig, hexRand, null);
        }

        protected override void WriteArchive(Hash hash, int blockIndex, byte[] data, Action<bool, string> callback)
        {
            callback(false, "not implemented on this connector yet");
        }
    }
}
